--[[
	un32SkillID:int#技能id
	skillIndex:int#技能下标
	baseSkillId:int#技能基础编号
	name:string#名称
	isMWSkill:int#是否是铭文技能
0不是，1是
	des:string#描述
	iconID:int#Icon
	level:int#等级
	levelMax:int#等级上限
	bIfNomalAttack:int#是否普通攻击
	n32UseMP:int#消耗MP
	n32UseHP:int#消耗HP
	interruptArmor:int#霸体等级（如果是怪,则只有受击）
	warmup:int#起手动作
	n32CoolDown:int#冷却时间
	beStorage:int#0 = 无吟唱
1 = 吟唱不可打断
2 = 吟唱可打断
	singAction:int#吟唱动作
	singTime:int#准备时间（PrepareSkill）
吟唱时间
	singanimation:string[]#吟唱特效
*_b_bip001_{r|l}_hand:绑定手 _b_2h 双手
*_w:绑定weaopen骨骼节点 _b_2w双武器
*_b_xxx:绑定xxx骨骼节点
*_bonexxx:绑定bonexxx骨骼节点
****：绑定对象自身锚点
	aimanimation:string#瞄准特效
aim_red_1 =矩形(自身锚点)
aim_red_2 =位移矩形(自身锚点)
aim_red_3 =标记箭头(目标锚点)
aim_red_4 =60°扇形(自身锚点)
aim_red_5 =90°扇形(自身锚点)
aim_red_6 =120°扇形(自身锚点)
aim_red_7 =150°扇形(自身锚点)
aim_red_8 =半圆(自身锚点)
aim_red_9 =圆形(自身锚点)
aim_red_10 =锁定圆(目标锚点)
aim_red_11 =圆形(目标锚点)
	value:int[]#瞄准参数
1={长,宽}
2={长,宽}
3=无
4=半径
5=半径
6=半径
7=半径
8=半径
9=半径
10=半径
	previewType:int#施法表现类型
0=无
1=圆圈
2=定向扇形aoe(60°)
3=定向扇形aoe(90°)(没资源)4=定向半圆aoe(180°)
5=地面施法
6=窄箭头
7=指向扇形aoe(60°)
8=指向扇形aoe(90°)(没资源)9=指向半圆aoe(180°)
10=指向扇形中心线单选(90°)
11=宽箭头
	previewValue:int[]#施法表现参数
0=无
1=半径
2=半径
3=半径
4=半径
5=半径
6=半径
7=无
11=宽,长
	attackAction:int#释放动作
在CfgAction.lua中查看
该lua在项目中搜索可找到
	attackanimation:string[]#释放特效
*_b_bip001_{r|l}_hand:绑定手 _b_2h 双手
*_w:绑定weaopen骨骼节点 _b_2w双武器
*_b_xxx:绑定xxx骨骼节点
*_bonexxx:绑定bonexxx骨骼节点
****：绑定对象自身锚点
	fashionEffect:string[][]#时装特效（命名规则和同 attackanimation 字段）
为一个二维数组，string[时装id][时装特效]
{{effect1},{effect2},……}
	guidAction:string#引导动作
	guidTime:int#引导时间（UsingSkill）
	guidAnimation:string[]#引导特效
	n32SkillLastTime:int#技能总时间
	lockCD:int#释放技能后，
摇杆锁定时间
	fReleaseDist:int#释放距离
	eUseWay:int#技能触发方式
 0  是  没有
 1, 是  主动
 2, 是  被动
 3, 是  攻击时
 4, 是  被攻击时
 5, 是  受击
 6,  是 死亡
 7,  是 使用
 8,  是 碰撞
	n32TriggerRate:int#触发概率
	bIfAffectRole:int#对角色有效
	bIfAffectMonster:int#对NPC有效
	eSkillTargetCate:int#技能施放时所选择的目标类型
1 是 自己
2 是 队员包含自己
3 是 队员不包含自己
4 是 敌人
5 是 所有单位
6 是 所有友方单位
	asSkillModelList:int[]#技能执行效果列表

读效果表id。id所在表由“技能类型”字段决定。
	n32Delay:int[]#技能前摇时间

*下层模块响应时间
	skillType:int#技能类型1=发射 SSkillModelEmitCfg.xlsx
2=移动 SSkillModelMoveCfg.xlsx
3=范围 SSkillModelRangeCfg.xlsx
4=召唤 SSkillModuleSummonCfg
	shockType:int[][]#无震屏效果,则此处不填
触发时间：震屏生效时间点,单位毫秒
xyz轴震幅：震屏轴向,填0.6,则轴向在-0.6-0.6之间震动。单位 米。
持续时长：震屏的持续时间,单位毫秒
频率：屏幕震动速度

{触发时间, , 持续时长,预留参数1, 预留参数2, 预留参数3, 预留参数4}
*预留参数可以随便填，但不能为空
	combo:int[][]#连招
{{连招Id，检测时长},...}
连招id：技能id
检测时长：此时间段内点击按钮将触发连招

详见“连招说明分页”
	keyInAdvance:int#按键响应
需要配合“连招”字段使用。
开始连招检测的时间点。

详见“连招说明分页”
	skillAudio:int[]#技能音效
声音,延迟(毫秒)
]]

